import React from "react";

export const ContactForm = ({
  name,
  phone,
  email,
  nameSetter,
  phoneSetter,
  emailSetter,
  submitHandler,
}) => {
  return (
    <form onSubmit={submitHandler}>
      <input
        placeholder="Name"
        type="text"
        value={name}
        onChange={(e) => nameSetter(e.target.value)}
      />
      <input placeholder="Phone" type="num" value={phone} />
      <input placeholder="email" type="text" value={email} />
    </form>
  );
};
